<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./main-frame2.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Inria Serif:wght@700&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Inter:wght@200;300;700&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Lato:wght@400;500;700&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Raleway:wght@400;500;600;700&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Joti One:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Istok Web:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Literata:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=PoetsenOne:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Racing Sans One:wght@400&display=swap"
    />
  </head>
  <body>
    <div class="main-frame2">
      <img class="image-25-icon7" alt="" src="./public/image-23@2x.png" />

      <div class="main-frame3">
        <img class="image-23-icon8" alt="" src="./public/image-23@2x.png" />

        <div class="image-22-container">
          <img
            class="image-22-icon8"
            loading="eager"
            alt=""
            src="./public/image-22@2x.png"
          />

          <div class="vector-parent30">
            <!-- <img class="frame-child49" alt="" src="./public/image-23@2x.svg" /> -->

            <div class="home-frame">
              <div class="home16" id="homeContainer">
                <div class="home17">Home</div>
              </div>
            </div>
            <div class="feed-container">
              <img
                class="feed-icon6"
                loading="eager"
                alt=""
                src="./public/feed.svg"
                id="feed"
              />
            </div>
            <div class="parent-frame2">
              <img
                class="contact-icon5"
                loading="eager"
                alt=""
                src="./public/contact.svg"
                id="contact"
              />
            </div>
            <div class="parent-frame3">
              <img
                class="explore-icon5"
                loading="eager"
                alt=""
                src="./public/explore.svg"
                id="explore"
              />
            </div>
            <div class="vector-nudge-wrapper">
              <img
                class="vector-nudge-icon"
                loading="eager"
                alt=""
                src="./public/vector.svg" style="height: 32px;width: 32px; top: 0px;"
              />
            </div>
            <div class="frame-parent14">
              <div class="vector-wrapper2">
                <img
                  class="vector-icon37"
                  alt=""
                  src="./public/vector-1.svg" style="height: 35px;width: 35px; top: 0px;"
                  id="vector"
                />
              </div>
              <img
                class="end-vector-icon"
                alt=""
                src="./public/vector-2.svg" style="height: 35px;width: 35px; top: 0px;"
                id="endVector"
              />

              <img
                class="icon-cog7"
                loading="eager"
                alt=""
                src="./public/-icon-cog.svg"
                id="iconCog" style="height: 35px;width: 35px; top: 0px;"
              />
            </div>
          </div>
        </div>
      </div>
      <main class="search-box-frame">
        <section class="search-bar">
          <div class="s-e-a-r-c-h-parent">
            <div class="s-e-a-r-c-h">
              <div class="s-e-a-r-c-h-child"></div>
              <h3 class="search">SEARCH</h3>
              <div class="image-113-wrapper">
                <img
                  class="image-113-icon"
                  alt=""
                  src="./public/image-139@2x.png"
                />
              </div>
            </div>
            <div class="image-116-parent">
              <img
                class="image-116-icon"
                alt=""
                src="./public/image-116@2x.png"
              />

              <img
                class="image-117-icon"
                loading="eager"
                alt=""
                src="./public/image-117@2x.png"
              />
            </div>
          </div>
          <div class="watch-history-wrapper">
            <div class="watch-history">
              <div class="text-label">
                <div class="watch-history1">Watch History</div>
              </div>
              <div class="frame-parent15">
                <div class="frame-wrapper15">
                  <div class="rectangle-parent4">
                    <div class="frame-child50"></div>
                    <div class="remove">Remove</div>
                  </div>
                </div>
                <div class="rectangle-parent5">
                  <input class="frame-child51" type="text" />

                  <div class="remove1">Remove</div>
                </div>
                <div class="more">
                  <div class="remove-button"></div>
                  <div class="remove2">Remove</div>
                </div>
                <div class="secondary-remove">
                  <div class="more1">more ...</div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </main>
      <div class="rectangle-shape">
        <!-- <img class="image-106-icon" alt="" src="./public/image-106@2x.png" /> -->

        <div class="image-119-parent">
          <img class="image-119-icon" alt="" src="./public/image-119@2x.png" />

          <!-- <img
            class="image-108-icon"
            loading="eager"
            alt=""
            src="./public/image-108@2x.png"
          /> -->
        </div>
        <img
          class="rectangle-shape-child"
          loading="eager"
          alt=""
          src="./public/image-137@2x.png"
          id="rectangle"
        />
      </div>
    </div>

    <script>
      var homeContainer = document.getElementById("homeContainer");
      if (homeContainer) {
        homeContainer.addEventListener("click", function (e) {
          window.location.href = "./main-frame1.html";
        });
      }

      var feed = document.getElementById("feed");
      if (feed) {
        feed.addEventListener("click", function (e) {
          window.location.href = "./frame-container1.html";
        });
      }

      var contact = document.getElementById("contact");
      if (contact) {
        contact.addEventListener("click", function (e) {
          window.location.href = "./main-frame3.html";
        });
      }

      var explore = document.getElementById("explore");
      if (explore) {
        explore.addEventListener("click", function (e) {
          window.location.href = "./main-frame4.html";
        });
      }

      var vector = document.getElementById("vector");
      if (vector) {
        vector.addEventListener("click", function (e) {
          window.location.href = "./main-frame5.html";
        });
      }

      // var endVector = document.getElementById("endVector");
      // if (endVector) {
      //   endVector.addEventListener("click", function (e) {
      //     window.location.href = "./main-frame6.html";
      //   });
      // }

      var iconCog = document.getElementById("iconCog");
      if (iconCog) {
        iconCog.addEventListener("click", function (e) {
          window.location.href = "./root-frame.html";
        });
      }

      var rectangle = document.getElementById("rectangle");
      if (rectangle) {
        rectangle.addEventListener("click", function (e) {
          window.location.href = "./frame-root2.html";
        });
      }
    </script>
  </body>
</html>
